import RegInput from "./RegInput";
import CarInfo from "./CarInfo";
import { useState } from "react";

function MotChecker() {
  const [carDetails, setCarDetails] = useState("");
  return (
    <div>
      <div class="max-w-md mx-auto bg-white rounded-xl shadow-xl overflow-hidden md:max-w-2xl mt-3">
        <div class="mb-3 py-3">
          <div class="md:shrink-0">
            <RegInput setCarDetails={setCarDetails} />
          </div>
        </div>
        <div class="px-8 pb-8">
          <CarInfo carDetails={carDetails} />
        </div>
      </div>
    </div>
  );
}

export default MotChecker;
